import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <header className="App-header">
      <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css" crossorigin="anonymous"></link>
      <div class="container">
        <div className="App">
           <nav class="navbar navbar-expand-sm bg-dark navbar-dark">

            <a class="navbar-brand" href="IOHome.html"><img src="" alt="Logo" style="widows: 80px;px;" href="IOHome.html" /></a>


            <ul class="navbar-nav">
              <li class="nav-item">
                <a class="nav-link" href=""></a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href=""></a>
              </li>
              </ul>
          </nav> 
        </div>

        </div>
    </header>



  );
}

export default App;
